function LTrim(str)
{for(var k=0;k<str.length&&str.charAt(k)<=" ";k++){};return str.substring(k,str.length);}
function RTrim(str)
{for(var j=str.length-1;j>=0&&str.charAt(j)<=" ";j--){};return str.substring(0,j+1);}
function Trim(str)
{return LTrim(RTrim(str));}
